var app = (function (document, $) {

    'use strict';
    var docElem = document.documentElement,

        _userAgentInit = function () {
            docElem.setAttribute('data-useragent', navigator.userAgent);
        },
        _init = function () {
            $(document).foundation();
            _userAgentInit();

            var t = new Trianglify({
                fillOpacity: 0.3,
                strokeOpacity: 0.2
            });
            var pattern = t.generate(document.body.clientWidth, document.body.clientHeight * 3);
            document.querySelector('#main-section').setAttribute('style', 'background-image: '+ pattern.dataUrl);//'url(data:image/png;base64,)');
//            document.classList.add('animate');
        };

    return {
        init: _init
    };

})(document, jQuery);

(function () {

    'use strict';
    app.init();

})();